import React, { Component } from 'react'

export class BigDisplay extends Component {
    render() {

        const bigDisplay = {
            padding: '85px 218px',
            backgroundColor: '#18474E',
            color: '#FFFFFF',
            textAlign: 'left',
            maxWIdth: '790px'
        }

        const bigDisplayTitle = {
            fontSize: '46px',
            fontWeight: 'bold'
        }

        const bigDisplayText = {
            fontSize: '33px'
        }

        return (
            <div style={bigDisplay}>
                <span style={bigDisplayTitle}>Can you please enter your tax identification number?</span>
            </div>
        )
    }
}

export default BigDisplay
